              <path id="Row12_-Side1_-Chain8" d="M1322.08,1769.76C1322.63,1769.82 1323.17,1769.89 1323.6,1769.87C1329.86,1769.56 1334.59,1772.03 1335.45,1772.48C1341.04,1775.4 1343.47,1779.68 1343.93,1780.49C1348.1,1787.83 1345.95,1795.04 1345.59,1796.26C1343.13,1804.46 1336.84,1807.94 1335.74,1808.55C1328.29,1812.67 1319.26,1811.58 1317.81,1811.4C1289.26,1807.96 1253.56,1769.79 1243.89,1714.78C1242.24,1705.38 1238.48,1680.33 1245.11,1647.16C1255.45,1595.45 1307.93,1546 1327.34,1526.21C1328.87,1524.65 1329.62,1523.82 1329.81,1523.6L1330.08,1523.82C1330.66,1522.87 1331.27,1521.92 1331.98,1521.06C1332.83,1520.02 1333.99,1519.25 1335.1,1518.5C1342.22,1513.71 1349.21,1514.97 1350.45,1515.19C1359.01,1516.73 1363.19,1522.91 1363.91,1523.97C1368.71,1531.06 1367.42,1538.14 1367.2,1539.38C1367.07,1540.05 1366.44,1543.54 1364.03,1547.29C1360.02,1553.56 1348.76,1562.87 1331.63,1581.67C1289.74,1627.67 1286.53,1651.46 1285.04,1660.42C1274.8,1722.28 1305.29,1761.18 1320.93,1769.23C1321.37,1769.46 1321.77,1769.63 1322.08,1769.76ZM1327.55,1527.68L1327.47,1527.65L1327.36,1527.92C1327.42,1527.84 1327.49,1527.76 1327.55,1527.68ZM1322.29,1778.94L1322.56,1780.66C1322.6,1780.8 1322.64,1780.95 1322.71,1781.23C1322.79,1780.26 1322.59,1779.33 1322.25,1778.41C1322.26,1778.58 1322.27,1778.76 1322.29,1778.94Z" stroke="#8B4513" stroke-width="3" fill="none"/>
